import RCompThumbnail from "../../assets/img/compositions/static.png";
import RCompPreview from "../../assets/img/compositions/dynamic.gif";

// const model = {
//     "id": "emtaoh28e",
//     "title": "Winter",
//     "variant": 0,
//     "price": 32.54,
// }

export const initialState = {
    pageTitle: 'compositions',
    compositions: [
        {
            id: 0,
            title: 'Lespo',
            price: 3.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            createdAt: new Date(),
            author: 'Vitaly',
            typeVariant: 0,
            background: '',
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        }, {
            id: 1,
            title: 'Newzo',
            price: 2.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            dateCreated: new Date(),
            author: 'Vitaly',
            typeVariant: 1,
            background: '',
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        }, {
            id: 2,
            title: 'Winter',
            price: 412.43,
            thumbnail: RCompThumbnail,
            preview: RCompPreview,
            dateCreated: new Date(),
            author: 'Vitaly',
            typeVariant: 2,
            background: '',
            inputs: {
                username: {
                    value: "qweik"
                },
                twitch: {
                    value: "twitch.tv/qweik"
                }
            }
        },
    ],
}

export function compositionsReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
